```powershell
param(
    [string]$ruleName = "Windows Logging",
    [string]$eventFilter = "*",
    [string]$logDirectory = "C:\Logs"
)

# Validate input parameters
if (-not ($ruleName -and $eventFilter)) {
    Write-Error "Missing or invalid parameter(s). Please see help for usage information."
} elseif (!$logDirectory) {
    Write-Warning "Default log directory (C:\Logs) not specified, using current directory instead."
    $logDirectory = $env:USERPROFILE
}

# Create event filter
[string]$filter = "-f `"$ruleName`""
if ($eventFilter.ToUpper().Contains("*")) {
    $filter = "*" + $eventFilter.ToUpper() + "*"
} else {
    $filter = $eventFilter
}

# Define event sources and filters
$eventSource = New-Object -ComObject Microsoft.Win32.EventLog
$eventSources = @(
    @{name = "Application"; sourceName = "My Application"; level = "Verbose"}
    @{name = "Windows Update"; sourceName = "Microsoft-Windows-Update"; level = "Information"}
)

# Check for important and not important status as specified by event log filter
$importantStatus = ($eventSource | Get-EventLog -LogName $logDirectory -Filter $filter | Where-Object {$_.EventID -eq 2147839680})
foreach ($source in $eventSources) {
    foreach ($status in @("Important", "Not Important")) {
        if ($importantStatus.Where{$_.Name -contains $status} -and $status -ne $importantStatus.Name) {
            Write-Warning "$($eventSource.Name) event source (ID: $source.EventID) matches the filter, but status is not 'Important' or 'Not Important.'"
        }
    }
}

# Check for events with matching rule and filename
$events = Get-WinEvent -FilterHashtable @{Name="LogicalDrive";Value="d:"} | Where-Object {$_.Message -match "$ruleName\s*:$eventFilter"}
foreach ($event in $events) {
    Write-Output ("Date/Time: " + $event.TimeGenerated)
    Write-Output ("Action: " + $event.ActionText)
    foreach ($property in @("TargetComputer", "TargetPath", "TargetUserName")) {
        if ($property -ne "") {
            $value = $event.$property
            $value = $nullIf($value, "Null")
            Write-Output ("Property: $property - Value: $value")
        }
    }
    foreach ($property in @("Computer", "User")) {
        if ($property -ne "") {
            $value = $event.Properties[$property]
            $value = $nullIf($value, "Null")
            Write-Output ("Property: $property - Value: $value")
        }
    }
}
