    if ($CreateIfMissing) {
      if (Test-Path $Path -IsValid) { Remove-Item -Force -Path $Path -ErrorAction Ignore } else { Set-Content -Path $Path -Value "" }
      $props.Attributes = Get-FileAttributes -Path $Path
    }

    return @{ Path = $Path; Properties = $props }
  }
}

function Get-LogFileEvents {
  param (
    [Parameter()]
    [string]$Path,
    [Parameter()]
    [int]$MinEvents,
    [Parameter()]
    [bool]$IncludeDuplicates
  )

  if ($null -eq $path) { return @{ Events = @{} } } else {
    $events = Get-LogFileContents -Path $Path

    if ($null -eq $events) { return @{ Events = @{} } }

    $maxEventID = 0
    foreach ($event in $events) {
      if (-not ($event.Message -match '^(.+)$')) { continue }

      $minEventsExceeded = (($event.EventID -ge $MinEvents) -and ((-not $IncludeDuplicates) -or ($event.EventID -eq $MaxLogFileEvents)))

      if (-not $minEventsExceeded) { continue } else {
        $maxEventID += $event.EventID
        $events = @{ Events = $events; EventID = $event.EventID; Message = $event.Message }
        return @{ Events = $events }
      }
    }

    return @{ Events = @{} }
  }
