import win32event, os, time

def import_winlog():
    try:
        with open('C:/Windows/System32/EventViewer/Admin/System/WinLog', 'r') as log:
            for entry in log:
                entry = entry.strip().split('\t')
                priority, task, time, message = entry[0], entry[1], entry[2], entry[3]
                if priority == 1 and (task == 'PipeCreate' and os.path.basename(message) == 'pipeEvent'):
                    priority = Importance.Important
    except IOError:
        pass
    else:
        winlog._write_event(time, message, priority=priority)

def write_winlog():
    import_winlog()

if __name__ == '__main__':
    import time
    import sys
    if len(sys.argv) != 2:
        print('Usage: {file} [optional priority]'.format(file=os.path.basename(__file__)))
        exit()

    try:
        file = os.path.abspath(sys.argv[1])
        if not os.path.isfile(file):
            print('{filename} does not exist'.format(filename=os.path.basename(file)))
            exit()

    except (IOError, ValueError) as e:
        print('Failed to import WinLog: {e}'.format(e=str(e)))
        exit()

    time.sleep(3)  # Wait for some time to let the Windows Event Log ingestion process complete
```

